【サイズ】約Φ８０×Ｈ２２５ｍｍ（持ち手含まず）<br>  
【素材】<br>
外側：ポリエステル１００％<br>
内側：アルミ蒸着シート・ＰＥ<br>
持ち手：合皮<br>
他部材有<br>
中国製<br><br>




フルカラープリントのイラストで、カラフルなボトルホルダーです。<br>
ファスナー引手はダヤン型♪<br>
持ち手のベルトは、ホック式で取り外し可能。<br>  
ランチバッグに付けたり、リュックに付けて持ち歩けます。<br>  
ペットボトルの５００ｍｌがスッポリ入ります。<br>
保冷＆保温で、一年中お役に立ちます。<br><br>



【ご確認事項】<br>
※曲がり具合やサイズに若干の違いが生じる場合があります。<br>
※加工段階での多少の汚れ・色ムラ・磨きキズや凹み・折り曲げ加工の微細なズレ・歪みがある場合もございます。<br>
メーカーより“良品”として販売されております。ご理解頂きご注文をお願い致します。<br><br>
<hr><br>
※イメージ写真の商品はセット品ではありません。<br>
※実際のお色と多少異なる事があります。<br><br>
区分：ネコ　黒ねこ　猫雑貨　ネコグッズ　キャット　cat
<br><br>
池田あきこ　わちふぃーるど　WACHIFIELD<br><br>

